@Angelicwings1 No, children are not more capable of knowing who they are than adults. They're like sponges, they soak up what is in their environment and it shapes who they become. Who they are is not set in stone, but no one is forcing children into being a boy or girl, they are literally born as a boy or girl. That's not a choice. If I give birth to a child with female genitalia, that's a girl. Being a child is already confusing and difficult enough. When you teach them that they have the option to change genders, that complicates things further for a young mind. If my daughter wants to wear boys clothes, I'll allow it, but I'm not going to introduce the idea of transitioning to her because that is planting an idea in a child's mind that they wouldn't have had otherwise. Evidenced by the number of people who want to identify under the trans umbrella suddenly exploding in the past 5 years, just as this became more mainstream. As I'm typing this, my boyfriend just scrolled through facebook and saw a FTM transgender from his high school who was obviously a girl in high school. If you don't think there's a correlation between exposure to trans ideology and the increase in transgender-identifying people, you're insane. 

You were miserable in as a girl because most children are miserable in their bodies, and it's not because they want to be the other gender. I was miserable in my body because I wanted to be prettier. I wanted straight hair, I wanted a smaller nose. I wanted to look more white. I hated that I was half ethnic. I didn't iDeNtIfY with other people of my ethnicity. Yet now I'm comfortable with who I am, it's almost like it's normal for children to be unhappy with themselves. You genuinely sound mentally ill. Wanting to change genders is just a symptom of your mental illness. 

Also, if you really and truly hated these things about yourself, you wouldn't be so complacent. Boo hoo you live in a rural area, that sounds like an excuse. If you were genuinely experiencing true gender dysphoria, you'd feel compelled to go as far as necessary to validate your identity. "Even if I transitioned now it still wouldn't work?" well yeah, you'd never be a boy, but you could take steps towards looking more like one. There are buses and trains. In today's political climate, it shouldn't be hard to find one in your closest big city. Why wouldn't it work? It literally works for the tons of other FTM people. If it were truly distressing to you, you would find a way. But I guess just complain on the internet instead, that works too right?

